import React from 'react';
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper
} from '@mui/material';

const GeneratedImage = () => {
    return (
        <Paper variant='outlined'>
            <Grid2 container sx={{ px: 4, py: 4 }}>
                <Box component='img' alt='image generate' src='' sx={{
                    width: '100%',
                    height: '600px'
                }}>

                </Box>
            </Grid2>
        </Paper>
    )
}

export default GeneratedImage
